import React from 'react';
import {
  Link
} from "react-router-dom";

import {
  Table, TableBody, TableCell,
  TableContainer, TableHead, TableRow, Paper,
  makeStyles
} from '@material-ui/core';

const useStyles = makeStyles({
  table: {
    minWidth: 650,
  },
});

export default function CustomTable(props) {
  const { bikes = [] } = props;
  const classes = useStyles();
  return (
    <TableContainer component={Paper} >
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Bike ID</TableCell>
            <TableCell align="right">Latitude</TableCell>
            <TableCell align="right">Longitude</TableCell>
            <TableCell align="right">Reserved</TableCell>
            <TableCell align="right">Disabled</TableCell>
            <TableCell align="right">Type</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {bikes.map(({ bike_id, lat, lon, is_disabled, is_reserved, vehicle_type }) => (
            <TableRow key={bike_id}>
              <Link to={`/${bike_id}`}>
                <TableCell component="th" scope="row">{bike_id}</TableCell>
              </Link>
              <TableCell align="right">{lat}</TableCell>
              <TableCell align="right">{lon}</TableCell>
              <TableCell align="right">{is_reserved ? 'yes' : 'no'}</TableCell>
              <TableCell align="right">{is_disabled ? 'yes' : 'no'}</TableCell>
              <TableCell align="right">{vehicle_type}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer >
  )
}
